import React, { useContext } from 'react';
import AppContextProvider from '../Provider/AppContext';

const Common = () => {
    const user = useContext(AppContextProvider);
    return (
        <div>
            <h2>I am the Common Guy</h2>
            <div key={user.id}>
                <p>First Name : {user.firstName}</p>
                <span></span>
            </div>

        </div>
    );
};

export default Common;
